import React from 'react';
import './App.css';
import firebase from '../firebase'
import { Button } from 'semantic-ui-react';

logout = event =>{
  event.preventDefault();
  firebase.auth().signOut()
}

function App() {
  return (
    <div className="App">
      <h1>
        <Button onClick={this.logout}>
          Logout
        </Button>
      </h1>
    </div>
  );
}

export default App;
